const Footer = () => {
    return (
        <footer className="footer py-5 mt-5" style={{backgroundColor:"#1C4A5B",color:"#Ffff"}}>
            <div className="container">
                <div className="row">
                    <div className="col-4">
                        <h4 className="">القائمة</h4>
                    </div>
                </div>
            </div>
        </footer>
    )
};


export default Footer;
